import './App.css';
import Login from "./login/Login";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="wrapper">
      <BrowserRouter>
        <Routes>
          <Route path="/login" element={<b>Login page</b>} />
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App;
